import { useEffect, useState } from "react";
import * as UserServices from "../../services/user.services";

function UserEventosList({participacion}){
    const [user, setUser] = useState(null);

    useEffect(() => {
        console.log('%cUserEventosList.jsx line:10 ', 'Entro aca' );
        console.log('%cUserEventosList.jsx line:11 participacion', 'color: #007acc;', participacion);
        UserServices.findByID(participacion.user_id)
        .then(u => {
            console.log('%cUserEventosList.jsx line:14 u', 'color: #007acc;', u);
            setUser(u)
            console.log('%cUserEventosList.jsx line:14 user', 'color: #007acc;', user);
        }
        )
        // eslint-disable-next-line
    }, [participacion])

    console.log('%cUserEventosList.jsx line:2 participacion', 'color: #007acc;', participacion);
    return (
        <>
            <li className="list-group-item">
                <div className="row">
                    <div className="col-md-2">
                        <img src={user.avatar} alt={user.name} className="img-thumbnail" />
                    </div>
                    <div className="col-md-10">
                        <div className="d-flex justify-content-between align-items-center">
                            <h3>{user.name}</h3>
                            <span className="badge badge-primary badge-pill">{participacion.rol}</span>
                        </div>
                        <p className="card-text">
                            {user.email}
                        </p>
                    </div>
                </div>
            </li>
        </>
    )
}
export default UserEventosList;
